import React from "react";

const Detail = () => {
  return (
    <div
      className="border justify-content-center"
      style={{
        width: 500,
        height: 100,
        margin: 50,
        backgroundColor: "#ccc",
        textAlign: "center",
      }}
    >
      <p>Floor Tiling</p>
      <p>Rs. 125/Sqft (vitrified) basic tile of Rs. 45/Sqft</p>
    </div>
  );
};
export const FullHome = () => {
  return <Detail />;
};

export const Bathroom = () => {
  return (
    <div className="border" style={{ width: 100, height: 100 }}>
      <h1>Bathroom</h1>
    </div>
  );
};
